import React from "react";
import ReactDOM from "react-dom";

const customeStyle = {
  color: "blue",
  textAlign: "Center",
  textTransform: "Capitalize",
};

customeStyle.border = "2px solid green";

ReactDOM.render(
  <>
    <h1 style={customeStyle}>My name is Sushant Dahal</h1>
  </>,
  document.getElementById("root")
);
